import {Button} from 'antd'
import Link from 'next/link'
import Router from 'next/router'

export default () => {
  function gotoTestB() {

    Router.push({
      pathname: '/test/b',
      query: {
        id: 1
      }
  })
  }

  return (
    <>
      <Link href='/a?id=5' as = '/a/5'>
        <Button>Index</Button>
      </Link>
      <Button onClick={gotoTestB}>test b</Button>
    </>
  )
}
